import React from 'react';
import logo from './logo.svg';
import './App.css';
import { subscribeToRoutes } from './api';

class App extends React.Component {
  constructor(props) {
    super(props);
    subscribeToRoutes((err, timestamp) => this.setState({ 
      timestamp 
    }));
  }
  render() {
    return (
      <div className="App">
        <p className="App-intro">
        This is the timer value: {this.state.timestamp}
        </p>
      </div>
    );
  }
}

export default App;
